т", "R-Home"], "42": ["Спасибо большое", "2021-04-17T11:05:54Z", "прозрачный", "0", 2, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "43": ["Хорошие, крепкие", "2021-04-16T12:35:21Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "44": ["Оч классные крючки, полотенца держатся в ванной отлично, уже несколько часов как висят. Из упаковки только один крючок был с небольшим браком - крепление шаталось, но это не критично, всё держится. Поди поищи такие крючки в магазинах возле дома. Брала похожие в Галамарте на присосках - даже мочалку не держат. А эти супер крутые!", "2021-04-15T18:09:25Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "51": ["Очень хорошо придумали крючки делать на клейкой основе, не надо \"мужа на час\" вызывать, а потом вымывать всю квартиру. Твердая пятерочка от меня!", "2021-04-13T18:37:42Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "52": ["Большую часть повесила в гардеробной комнате, одежду, пакеты с мелочевкой выдерживают отлично.", "2021-04-12T19:36:17Z", "прозрачный", "0", 2, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "53": ["Обычные прозрачные крючки, исправно выполняют возложенные на них функции, еще ни один не отпал", "2021-04-12T18:34:35Z", "прозрачный", "0", 2, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "55": ["Крючки мягко говоря так себе. Приклеены к основе не ровно, испачканы в чём-то.", "2021-04-11T20:51:57Z", "прозрачный", "0", 0, 1, 2, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванн