 настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "193": ["Колючки замечательные, выдерживают маленькую сковородку", "2021-03-10T08:41:22Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "194": ["Крючки понравились. СПАСИБО!!!", "2021-03-09T20:09:14Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "195": ["Рада покупке, очень нужные! Крепко крепятся, даже на обоях держатся!👍", "2021-03-09T08:26:52Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "196": ["Классные крючки. Прилип даже не на совсем ровной плитке ♥️🙏🏼", "2021-03-08T20:34:00Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "234": ["Классные крючки, клеить на стену одно удовольствие, а факт, что можно использовать повторно, радует вдвойне. Пока приклеила только в ванной, но планирую еще один набор заказать для кухни и коридора. ", "2021-03-02T16:43:14Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "242": ["Крепкие крючки, в основном использую в кухне, кружки, полотенца выдерживают само собой, пробовала даже пятилитровую бутылку с водой подвесить - выдержали. Рекомендую!", "2021-03-01T18:49:32Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "247": ["Спасибо за такой товар, очень удобно и довольно прочно. Фен в ванной уже висит второй месяц и норм, а про всякие ложечки на кухне я вообще молчу.", "2021-02-28T18:05:42Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске 