ну/ванную/кухню / Набор 10шт", "R-Home"], "404": ["Классный и удобный товар. Брала для тряпок на кухню, наклеила на обратную сторону дверцы на фасаде. Держится хорошо!", "2020-12-25T11:18:28Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "405": ["Удобные, можно вертикально или горизонтально клеить , крючок поворачивается, что очень удобно, держится крепко, посмотрим сколько прослужит.", "2020-12-24T19:49:12Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "406": ["Хорошие. На плитке держатся", "2020-12-24T07:44:56Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "407": ["Повесила на крючки фен и плойку, держат , не отваливаются", "2020-12-23T16:20:54Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "408": ["Взяла по скидке, выгодная покупка, крючков в комплекте 10 штук, можно навтыкать по всему дому", "2020-12-23T16:12:43Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "409": ["Смотрятся хорошо, почти незаметны, крючки понравились", "2020-12-23T15:46:07Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "410": ["повесила под зеркало в ванной - супер!", "2020-12-23T14:35:18Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "411": ["Все как в описании, набор без брака, доставка быстрая", "2020-12-23T14:29:33Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "412": ["Набор четко подошел к моей ванной комнате, развесила их везде - для полотенец, внизу для тряпок, получилось аккуратно и красиво", "2020-12-23T14:23:22Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "413": ["Держат на кухне различные приборы, пока что не отваливаются, все супер", "2020-12-23T10:48:12Z", "прозрачный", "0", 3, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "414": ["Заказывала чтоб приклеить на дерево на улице .отлично все!теперь вставь гирлянды на улице )))\r\nНичего не обезжиривала .просто приклеила секунду подержала .все держится .", "2020-12-23T08:39:21Z", "прозрачный", "0", 4, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "415": ["Крючки не слишком большие, смотрятся очень аккуратно (идеально подошли для того, чтобы подвесить гирлянду на окне).", "2020-12-22T17:43:07Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "416": ["Все классно, рекомендую", "2020-12-22T17:38:20Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "417": ["Крепкие и подходят под многие дизайны, такие лаконичные и универсальные крючки, держатся нормально", "2020-12-22T17:23:05Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "418": ["Отличное решение тому, кто не хочет сверлить плитку в ванной, такие крючки это просто находка!", "2020-12-22T17:16:07Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "419": ["Налепливаются куда угодно, проблем нет", "2020-12-22T17:10:58Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "420": ["Купила по акции крючки для ванны, держатся идеально и совсем не отклеиваются!", "2020-12-22T17:09:28Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "421": ["Отлично крепятся, крючки качественные и стильные", "2020-12-22T17:06:30Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "422": ["Из 10 крючков,3 отвалились через несколько часов.Разбился эстамп,весом 200 гр,хотя поверхность кафель,обезжирили перед приклеивание крючков. Боюсь ещё что-то вешать.  Огорчена качеством.Не покупайте!!!! Не советую", "2020-12-22T11:41:16Z", "прозрачный", "0", 2, 0, 2, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "423": ["Крючки пришли в полном комплекте,  на стену приклеились легко", "2020-10-09T14:56:17Z", "прозрачный", "0", 1, 0, 5, "Крючок прозрачный силиконовый | Набор для кухни и ванной| Комплект из 10 штук | Водонепроницаемые", "R-Home"], "425": ["Отличные крючки, приклеились хорошо.", "2020-10-09T14:47:37Z", "прозрачный", "0", 1, 0, 5, "Крючок прозрачный силиконовый | Набор для кухни и ванной| Комплект из 10 штук | Водонепроницаемые", "R-Home"], "427": ["Прозрачные и не бросаются в глаза, хорошо войдут в любой интерьер. Крепятся просто, держаться хорошо, несмотря на то, что поверхность плитки не совсем гладкая.  Приклеила на обезжиренную поверхность неделю назад, никаких намёков на попытку отклеится. Выдерживают фен, щетку и швабру, на более тяжелых вещах не испытывала. \r\n\r\nОтличные крючки, хорошо держат, заявленному описанию соответствуют.", "2020-12-22T11:23:12Z", "прозрачный", "0", 2, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "428": ["Крючки пришли хорошие соответствуют заявленным требованиям", "2020-12-21T15:20:12Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "429": ["Ключки отличные.", "2020-12-21T14:11:55Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "430": ["Хорошие крючки. Крепёж крепкий и простой. Я в восторге", "2020-12-21T12:33:23Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "431": ["Да  упаковка оставляет желать лучшего, но крючки плотно сели на кафель и уже довольно давно крепко держатся, используем только для полотенца.", "2020-12-21T11:11:10Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "432": ["Крючки держаться хорошо. Главное обезжирить поверхность.", "2020-12-18T03:45:39Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "433": ["Пришли немного мятые. Использовала те, что выровнялись (просто выложила на ровную поверхность на два дня).. Главное хорошо обезжирить поверхность перед наклеиванием.", "2020-12-21T10:58:36Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "434": ["Совсем плохая клиевая основа не держать", "2020-12-21T07:44:04Z", "прозрачный", "0", 1, 1, 1, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "435": ["Снимаю звезду за то ", "2020-12-19T09:42:58Z", "прозрачный", "0", 1, 0, 4, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "437": ["Из 10 шт 3 сильно перекошены и не приклеиваются. Но те что приклеиваются держатся хорошо. Клеила на дверь. Пришли в обыкновенном пакете, поэтому могли помяться при доставке, это большой минус продавцу.", "2020-12-20T16:23:01Z", "прозрачный", "0", 1, 1, 4, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "438": ["💯💯💯💯💯💯💯💯💯💯", "2020-12-20T15:39:01Z", "прозрачный", "0", 3, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "439": ["Соответствует", "2020-12-20T14:27:11Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "440": ["Хорошие крючки, на гладкой плитке держатся отлично, на обоях отклеиваются в уголках, но не падают.", "2020-12-20T10:45:49Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "441": ["Крючки 👍заказываю второй раз.", "2020-12-19T09:41:34Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "442": ["Огонь, все держится не отваляться", "2020-12-19T08:16:31Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "445": ["Отличные! Хорошо держатся!", "2020-12-18T15:18:14Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "446": ["Хорошие крючки, нам понравились , используем в ванной , держатся отлично!", "2020-12-18T08:14:44Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "447": ["Без присоски. Держится на самоклейке. Минус звезда за неточное описание ", "2020-12-18T07:09:42Z", "прозрачный", "0", 1, 0, 4, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "448": ["Крючки не силиконовые ((( пришли все мятые. Пыталась их распремить феном, не все успешно ( приклеила на плитку керамическую, через сутки стали отваливатся. Печаль... Если пишут, что сковороды на них держаться то моя гирлянда нет.", "2020-12-17T07:54:48Z", "прозрачный", "0", 4, 0, 3, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "449": ["Заказываю второй раз. Отличный товар!!!", "2020-12-16T18:13:31Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "450": ["Нормальные крючки. Из 10 пришло 9 и 2 из них сломаны, некоторые с сильными заломами на клеевой части", "2020-12-16T14:47:34Z", "прозрачный", "0", 1, 0, 4, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "451": ["То, что я искала и нашла! Надо было повесить новогодний венок на входную дверь. Крючок держит прекрасно и совсем незаметен. И, самое главное, уже проверила: без труда отклеивается и не оставляет следов. Спасибо!", "2020-12-16T10:30:04Z", "прозрачный", "0", 3, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "452": ["Как всегда всё чудесно!!!", "2020-12-16T07:14:12Z", "прозрачный", "0", 1, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самоклеящийся на стену/ванную/кухню / Набор 10шт", "R-Home"], "453": ["Обожаю эти крючки. Заказываю уже второй раз. Да, некоторые слетают, но теперь я дополнительно промазываю клеем.", "2020-12-15T18:38:22Z", "прозрачный", "0", 9, 0, 5, "Крючок силиконовый настенный на присоске прозрачный самокле